script: |
  super -f tsv -I q3475.sql | sort > q3475.out

vector: true

inputs:
  - name: q3475.sql
    data: |
      SELECT ALL 50 FROM tab0 WHERE CAST ( - - col0 AS INTEGER ) - + col1 NOT BETWEEN - col2 AND + 61 OR NOT - 65 - col2 NOT BETWEEN NULL AND - col1 * - col0;
  - name: tab0

outputs:
  - name: q3475.out
    data: |
      50
      50
      50
